import React from 'react'
import { View, Text } from 'react-native'

const RepositoryItem = ( item ) => {
    console.log(item)
    return (
        <View>
            {item.map(i => <Text key={item.id}>{i.fullName}</Text>)}
        </View>
    )
}
export default RepositoryItem
